{%raw%}
 <script id="facets-view-pagination" type="text/x-handlebars-template">
  {{#if needsPagination}}
   <ul class="pagination">
    {{#ifvalue pageNumber value=1}}
     <li class="disabled"><span class="aspNetDisabled" aria-label="{%endraw%}{{ resx.Pagination_First_Page }}{%raw%}">«</span></li>
     <li class="disabled"><span class="aspNetDisabled" aria-label="{%endraw%}{{ resx.Pagination_Previous_Page }}{%raw%}">‹</span></li>
    {{else}}
     <li><a class="js-go-to-1" aria-label="{%endraw%}{{ resx.Pagination_First_Page }}{%raw%}" href="">«</a></li>
     <li><a class="js-go-to-{{previousPage}}" aria-label="{%endraw%}{{ resx.Pagination_Previous_Page }}{%raw%}" href="">‹</a></li>
    {{/ifvalue}}
    {{#each pageLinks}}
     {{#ifvalue this value=../pageNumber}}
      <li class="active" aria-label="{{ stringFormat "
       {%endraw%}{{ resx.Pagination_Current_Page }}{%raw%}" this}}" tabIndex="0"><span>{{this}}</span></li>
     {{else}}
      <li><a class="js-go-to-{{this}}" aria-label="{{ stringFormat "
       {%endraw%}{{ resx.Pagination_Page }}{%raw%}" this}}" href="">{{this}}</a></li>
     {{/ifvalue}}
    {{/each}}

    {{#ifvalue pageNumber value=pageCount}}
     <li class="disabled"><span aria-label="{%endraw%}{{ resx.Pagination_Next_Page }}{%raw%}">›</span></li>
     <li class="disabled"><span aria-label="{%endraw%}{{ resx.Pagination_Last_Page }}{%raw%}">»</span></li>
    {{else}}
     <li><a class="js-go-to-{{nextPage}}" aria-label="{%endraw%}{{ resx.Pagination_Next_Page }}{%raw%}" href="">›</a></li>
     <li><a class="js-go-to-{{pageCount}}" aria-label="{%endraw%}{{ resx.Pagination_Last_Page }}{%raw%}" href="">»</a></li>
    {{/ifvalue}}
   </ul>
  {{/if}}
 </script>
 {% endraw %}

{% assign snippet_name = snippet_name %}
{% if snippet_name %}
 {% editable snippets snippet_name type: 'html' %}
{% endif %}

{% assign page_type = page_type %}

<div class="tabs-header" id="mainContent">
  <ul class="nav nav-tabs">
    {% if page_type == 'topic' %}
      <li role="presentation">
        <a title="{{ page.parent.title }}" href="{{ page.parent.url }}">{{ page.parent.title }}</a>
      </li>
      {% for child in page.parent.children %}
        {% if child.title == page.title %}
          <li role="presentation" class="active">
            <a title="{{ page.title }}" href="{{ page.url }}">{{ page.title }}</a>
          </li>
        {% else %}
        <li role="presentation">
          <a title="{{ child.title }}" href="{{ child.url }}">{{ child.title }}</a>
        </li>
        {% endif %}
      {% endfor %}
    {% else %}
      <li role="presentation" class="active">
        <a title="{{ page.title }}" href="{{ page.url }}">{{ page.title }}</a>
      </li>
      {% for child in page.children %}
        <li role="presentation">
          <a title="{{ child.title }}" href="{{ child.url }}">{{ child.title }}</a>
        </li>
      {% endfor %}
    {% endif %}
  </ul>
</div>

{%raw%}
<script id="search-order-select" type="text/x-handlebars-template">
  {{#if sortingOptions}}
  <select id="search_sort_options" tabIndex="0" aria-readonly="true">
    {{#each sortingOptions}}
      {{#ifvalue this value="relevance" }}
        <option value="{{this}}">{%endraw%} {% editable snippets "Search/Facet/SortOrder/Relevance" default: resx.Sorting_Relevance %}{%raw%}</option>
      {{/ifvalue}}
      {{#ifvalue this value="rating" }}
        <option value="{{this}}">{%endraw%} {% editable snippets "Search/Facet/SortOrder/AverageUserRating" default: resx.Sorting_Rating %}{%raw%}</option>
      {{/ifvalue}}
      {{#ifvalue this value="knowledgearticleviews" }}
        <option value="{{this}}">{%endraw%} {% editable snippets "Search/Facet/SortOrder/Views" default: resx.Sorting_ViewCount %}{%raw%}</option>
      {{/ifvalue}}
    {{/each}}
  </select>
  <label for="search_sort_options" class="sr-only">{%endraw%}{{resx.Sorting_Options}}{%raw%}</label>
  {{/if}}
</script>
{% endraw %}

{% assign current_page = current_page | default: 1 %}
{% assign page_size = page_size | default: 10 %}
{% assign total = total | default: 0 %}
{% assign limit = 5 %}

{% assign total_pages_remainder = total | modulo: page_size %}
{% if total_pages_remainder > 0 %}
  {% assign total_pages = total | divided_by: page_size | plus: 1 %}
{% else %}
  {% assign total_pages = total | divided_by: page_size %}
{% endif %}

{% if total_pages > 1 %}
  {% assign prev_page = current_page | minus: 1 %}
  {% assign next_page = current_page | plus: 1 %}
  
  {% assign start_page = 0 %}
  {% assign offset = limit | divided_by: 2 %}
  {% assign page_offset = current_page | minus: 1 %}
  {% if page_offset > offset %}
    {% assign start_page = current_page | minus: offset | minus: 1 %}
  {% endif %}
     
  <ul class="pagination">
  {% if current_page == 1 %}
      <li class="disabled"><a href="{{ request.url | add_query: 'page', '1' | path_and_query | escape }}">«</a></li>
      <li class="disabled"><a href="{{ request.url | add_query: 'page', prev_page | path_and_query | escape }}">‹</a></li>
  {% else %}
      <li><a href="{{ request.url | add_query: 'page', '1' | path_and_query | escape }}">«</a></li>
      <li><a href="{{ request.url | add_query: 'page', prev_page | path_and_query | escape }}">‹</a></li>
  {% endif %}

  {% for page in (1..total_pages) offset: start_page limit: limit %}
     <li{% if page == current_page %} class="active"{% endif %}>
       <a href="{{ request.url | add_query:'page', page | path_and_query | escape }}"> {{ page }}</a>
     </li>
  {% endfor -%}      

  {% if current_page == total_pages %}
      <li class="disabled"><a href="#" aria-label="Next">›</a></li>
      <li class="disabled"><a href="#" aria-label="Last">»</a></li>
  {% else %}
      <li><a href="{{ request.url | add_query: 'page', next_page | path_and_query | escape }}">›</a></li>
      <li><a href="{{ request.url | add_query: 'page', total_pages | path_and_query | escape }}">»</a></li>
  {% endif %}
  </ul>
{% endif %}

{% assign openTag = '{{' %}
{% assign closingTag = '}}' %}
 {%raw%}
  <script id="search-view-results" type="text/x-handlebars-template">
   {{#if items}}
    <div class="page-header">
      <h2 role="status" aria-live="off">{%endraw%}{{openTag}} stringFormat "{{ resx.Search_Results_Format_String }}" firstResultNumber lastResultNumber itemCount {{closingTag}}{%raw%}
      <em class="querytext">{{{query}}}</em>
     {{#if isResetVisible}}
       <a class="btn btn-default btn-sm facet-clear-all" role="button" title="{%endraw%}{{ snippets['Search/Facet/ClearConstraints'] | default: res['Search_Filter_Clear_All'] }}{%raw%}" tabIndex="0">{%endraw%}{{ snippets['Search/Facet/ClearConstraints'] | default: res['Search_Filter_Clear_All'] }}{%raw%}</a>
      {{/if}}
      </h2>
    </div>
    <div>
   <ul>
    {{#each items}}
     <li>
      <h3><a title="{{title}}" href="{{url}}">{{#if parent}}<span class="glyphicon glyphicon-file pull-left text-muted" aria-hidden="true"></span>{{/if}}{{title}}</a></h3>
      <p class="fragment">{{{fragment}}}</p>
      {{#if parent}}
       <p class="small related-article">{%endraw%}{{ resx.Related_Article }}{%raw%}: <a title="{{parent.title}}" href="{{parent.absoluteUrl}}">{{parent.title}}</a></p>
      {{/if}}
      <ul class="note-group small list-unstyled">
       {{#if relatedNotes}}
        {{#each relatedNotes}}
         <li class="note-item">
         {{#if isImage}}
          <a target="_blank" title="{{title}}" href="{{absoluteUrl}}"><span class="glyphicon glyphicon-file" aria-hidden="true"></span> {{title}}</a>
         {{else}}
          <a title="{{title}}" href="{{absoluteUrl}}"><span class="glyphicon glyphicon-file" aria-hidden="true"></span> {{title}}</a>
         {{/if}}
         <p class="fragment text-muted">{{{fragment}}}</p>
         </li>
        {{/each}}
        {{/if}}
      </ul>
     </li>
    {{/each}}
   </ul>
  </div>
   {{else}}
   <h2 role="status">{%endraw%}{{ resx.Search_No_Results_Found }}{%raw%}<em class="querytext">{{{query}}}</em>
     {{#if isResetVisible}}
      <a class="btn btn-default btn-sm facet-clear-all" role="button" title="{%endraw%}{{ snippets['Search/Facet/ClearConstraints'] | default: res['Search_Filter_Clear_All'] }}{%raw%}" tabIndex="0">{%endraw%}{{ snippets['Search/Facet/ClearConstraints'] | default: res['Search_Filter_Clear_All'] }}{%raw%}</a>
     {{/if}}
    </h2>
   {{/if}}
  </script>
 {%endraw%}

{% assign defaultlang = settings['LanguageLocale/Code'] | default: 'en-us' %}
{% assign homeurl = website.adx_partialurl %}
<div class="navbar navbar-inverse navbar-static-top" role="navigation">
    <div class="skip-to-content"><a href="#mainContent">{{ resx.Skip_To_Content | default: "Skip to main content" }}</a></div><div class="container">
        <div class="navbar-header">

            <!--div class="visible-xs-block">
              {% editable snippets 'Mobile Header' type: 'html' %}
            </div-->
            <div class="visible-sm-block visible-md-block visible-lg-block visible-xs-block navbar-brand">
                {% editable snippets 'Mobile Header' type: 'html' %}
            </div>
            <button type="button" class="navbar-toggle collapsed" title="{{ snippets["Header/Toggle Navigation"] | default: resx['Toggle_Navigation'] | h }}" data-toggle="collapse" data-target="#navbar" aria-expanded="false" onclick="setHeight();">
                <span class="sr-only">{{ snippets["Header/Toggle Navigation"] | default: resx['Toggle_Navigation'] | h }}</span>
                <span class="icon-bar"></span>
                <span class="icon-bar"></span>
                <span class="icon-bar"></span>
            </button>
        </div>
        <div id="navbar" class="navbar-collapse collapse">
            {% assign primary_nav = weblinks["Default"] %}
            {% if primary_nav %}
            <nav aria-label="{{ resx.Main_Navigation | default: "Main Navigation" }}" class="navbar-right menu-bar {% if primary_nav.editable %}xrm-entity xrm-editable-adx_weblinkset{% endif %}" data-weblinks-maxdepth="2">
                <ul class="nav navbar-nav weblinks">
                    {% for link in primary_nav.weblinks %}
                    {% unless forloop.first %}
                    <li class="divider-vertical" aria-hidden="true"></li>
                    {% endunless %}
                    {% if link.display_page_child_links %}
                    {% if link.url != null %}
                    {% assign sublinks = sitemap[link.url].children %}
                    {% endif %}
                    {% else %}
                    {% assign sublinks = link.weblinks %}
                    {% endif %}
                    <li role="none" class="weblink {% if sublinks.size > 0 %} dropdown{% endif %}">
                        <a aria-label="{{ link.name | escape }}" aria-roledescription = "link" {% if sublinks.size > 0 -%} href="#" class="dropdown-toggle" data-toggle="dropdown" {%- else -%} href="{{ link.url | escape }}" {%- endif -%} {%- if link.Open_In_New_Window %} target="_blank" {% endif -%} {%- if link.nofollow %} rel="nofollow" {% endif -%} {%- if link.tooltip %} title="{{ link.tooltip | escape }}" {% endif %}>
                            {%- if link.image -%}
                            {%- if link.image.url  -%}
                            {%- if link.image.url.first == '.' -%}
                            <span class="{{ link.image.url | split:'.' | join }}" aria-hidden="true"></span>
                            {%- endif -%}
                            {%- else -%}
                            <img src="{{ link.image.url | escape }}" alt="{{ link.image.alternate_text | default:link.tooltip | escape }}" {% if link.image.width %}width="{{ link.image.width | escape }}" {% endif %} {% if link.image.height %}height="{{ link.image.height | escape }}" {% endif %} />
                            {%- endif -%}
                            {%- endif -%}
                            {%- unless link.display_image_only -%}
                            {{ link.name | escape }}
                            {%- endunless -%}
                            {%- if sublinks.size > 0 -%}
                            <span class="caret"></span>
                            {%- endif -%}
                        </a>
                        {% if sublinks.size > 0 %}
                        <ul class="dropdown-menu" aria-roledescription = "link">
                            {% if link.name %}
                            <li role="none">
                                <a aria-label="{{ link.name | escape }}" aria-roledescription = "link" href="{{ link.url }}" {% if link.Open_In_New_Window %} target="_blank" {% endif %} {% if link.nofollow %}rel="nofollow" {% endif %} {% if link.tooltip %}title="{{ link.tooltip | escape }}" {% endif %}>{{ link.name | escape }}</a>
                            </li>
                            <div class="divider"></div>
                            {% endif %}
                            {% for sublink in sublinks %}
                            <li role="none">
                                <a aria-label="{{ sublink.name | default:sublink.title | escape }}" aria-roledescription = "link" href="{{ sublink.url }}" {% if sublink.Open_In_New_Window %} target="_blank" {% endif %} {% if sublink.nofollow %}rel="nofollow" {% endif %} {% if sublink.tooltip %}title="{{ sublink.tooltip | escape }}" {% endif %}>
                                    {{ sublink.name | default:sublink.title | escape }}
                                </a>
                            </li>
                            {% endfor %}
                        </ul>
                        {% endif %}
                    </li>
                    {% endfor %}
                    {% assign search_enabled = settings['Search/Enabled'] | boolean | default:true %}
                    {% if search_enabled %}
                    <li class="divider-vertical" aria-hidden="true"></li>
                    <li role="none" class="dropdown">
                        <a id="search" class="navbar-icon" href="#" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false" aria-label="{{ snippets["Header/Search/ToolTip"] | default:resx["Search_DefaultText"] | escape }}">
                            <span class="glyphicon glyphicon-search"></a>
                        </a>
                        <div class="dropdown-menu dropdown-search">
                            {% include 'Search' search_id:'q' %}
                        </div>
                    </li>
                    {% endif %}
                    <li class="divider-vertical" aria-hidden="true"></li>
                    {% if website.languages.size > 1 %}
                    <li class="dropdown" role="none">
                        <a class="dropdown-toggle" aria-roledescription = "link" href="#" data-toggle="dropdown" aria-label="{{ website.selected_language.name | escape }}" aria-haspopup="true" aria-expanded="false" title="{{ website.selected_language.name | escape }}">
                            <span class="drop_language">{{ website.selected_language.name | escape }}</span>
                            <span class="caret"></span>
                        </a>
                        {% include 'Languages Dropdown' %}
                    </li>
                    <li class="divider-vertical" aria-hidden="true"></li>
                    {% endif %}
                    {% if user %}
                    <li class="dropdown" role="none">
                        {% assign username=user.fullname | escape %}
                        <a href="#" class="dropdown-toggle" aria-roledescription = "link" title="{{username | default: resx['Default_Profile_name'] }}" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            <span class="username">{{ username | default: resx['Default_Profile_name'] }}</span>
                            <span class="caret"></span>
                        </a>
                        <ul class="dropdown-menu">
                            {% assign show_profile_nav = settings["Header/ShowAllProfileNavigationLinks"] | boolean | default:true %}
                            {% if show_profile_nav %}
                            {% assign profile_nav = weblinks["Profile Navigation"] %}
                            {% if profile_nav %}
                            {% for link in profile_nav.weblinks %}
                            <li role="none">
                                <a aria-label="{{ link.name | escape }}" aria-roledescription = "link" href="{{ link.url | escape }}" title="{{ link.name | escape }}">{{ link.name | escape }}</a>
                            </li>
                            {% endfor %}
                            {% endif %}
                            {% else %}
                            <li role="none"><a aria-label="{{ snippets["Profile Link Text"] | default:resx["Profile_Text"] | escape }}" aria-roledescription = "link" href="{{ sitemarkers['Profile'].url | escape }}">{{ snippets["Profile Link Text"] | default:resx["Profile_Text"] | escape }}</a></li>
                            {% endif %}
                            <li class="divider" role="separator" aria-hidden="true"></li>
                            <li role="none">
                                <a aria-label="{{ snippets["links/logout"] | default:resx["Sign_Out"] | escape }}" aria-roledescription = "link" href="{% if homeurl%}/{{ homeurl }}{% endif %}{{ website.sign_out_url_substitution }}" title="{{ snippets["links/logout"] | default:resx["Sign_Out"] | escape }}">
                                    {{ snippets["links/logout"] | default:resx["Sign_Out"] | escape }}
                                </a>
                            </li>
                        </ul>
                    </li>
                    {% else %}
                    <li role="none">
                        <a aria-label="{{ snippets["links/login"] | default:resx["Sign_In"] | escape }}" aria-roledescription = "link" href="{% if homeurl%}/{{ homeurl }}{% endif %}{{ website.sign_in_url_substitution }}">
                            {{ snippets["links/login"] | default:resx["Sign_In"] | escape }}
                        </a>
                    </li>
                    {% endif %}
                </ul>
                {% editable primary_nav %}
            </nav>
            {% endif %}
        </div>
    </div>
</div>
{% substitution %}
